import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import './Home.css';

const Home = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5, // Показуємо 5 фото одночасно
    slidesToScroll: 1, // Переміщуємо по 1 слайду
    autoplay: true,
    autoplaySpeed: 3000,
    pauseOnHover: true,
    arrows: true,
    adaptiveHeight: false,
    fade: false,
    cssEase: 'linear',
    responsive: [
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 4,
        }
      },
      {
        breakpoint: 992,
        settings: {
          slidesToShow: 3,
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 2,
        }
      },
      {
        breakpoint: 576,
        settings: {
          slidesToShow: 1,
        }
      }
    ]
  };

  // Масив з 10 фото для каруселі
  const slides = Array.from({ length: 10 }, (_, index) => ({
    id: index + 1,
    src: `https://placecats.com/200/150?${index + 1}`,
    alt: `Галерея ${index + 1}`
  }));

  return (
    <div className="home-page">
      <section className="about">
        <div className="container">
          <div className="about-content">
            <img src="/img/about.jpg" alt="Про школу" />
            <div className="about-text">
              <h2>Ласкаво просимо до школи мистецтв «Антарес»</h2>
              <p>
                Наша школа - це сучасний освітній простір, де діти розкривають 
                свої творчі здібності та опановують різні види мистецтва.
              </p>
              <p>
                Ми пропонуємо навчання за різними напрямами: музика, образотворче 
                мистецтво, хореографія та театральне мистецтво.
              </p>
              <a href="/site/about" className="learn-more">Дізнатися більше</a>
            </div>
          </div>
        </div>
      </section>

      <section className="activities">
        <div className="container">
          <h2>Наші напрямки навчання</h2>
          <p>Виберіть напрямок, який вас цікавить</p>
          <div className="activity-list">
            <div className="activity">
              <img src="/img/music.jpg" alt="Музичний відділ" />
              <h3>Музичний відділ</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
            <div className="activity">
              <img src="/img/art.jpg" alt="Художній відділ" />
              <h3>Художній відділ</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
            <div className="activity">
              <img src="/img/dance.jpg" alt="Хореографія" />
              <h3>Хореографія</h3>
              <a href="/site/departments">Детальніше</a>
            </div>
          </div>
        </div>
      </section>

      <section className="gallery">
        <div className="container">
          <h2>Галерея</h2>
          <div className="carousel-container">
            <Slider {...settings}>
              {slides.map((slide) => (
                <div key={slide.id} className="carousel-slide">
                  <img
                    src={slide.src}
                    alt={slide.alt}
                    className="carousel-image"
                    onError={(e) => {
                      e.target.src = `https://via.placeholder.com/200x150/4AAFF7/FFFFFF?text=Фото+${slide.id}`;
                    }}
                  />
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
